import { TextField, ThemeProvider, unstable_createMuiStrictModeTheme } from '@material-ui/core';
import React, { useState } from 'react'

const Search = () => {
   
   const [type,setType] = useState(0);
   const darkTheme = unstable_createMuiStrictModeTheme({
     palette:{
       type:"dark",
       primary:{
         main:"#fff",
       }
     }
   })



  return (
    <div>
      <ThemeProvider theme={darkTheme}>
        
        <TextField
       style={{ flex:1}}
       className="searchBox"
       label="Search"
       variant='filled'
       //onChange={(e) => setSearchText(e.target.value)}
        />
      </ThemeProvider> 
       

    </div>
  )
}

export default Search
